namespace io.vyne.films.idlookup {
   model IdResolution {
      filmId : films.FilmId
      netflixId : demo.netflix.NetflixFilmId
      squashedTomatoesFilmId : films.reviews.SquashedTomatoesFilmId
   }

   service IdLookupService {
      @HttpOperation(method = "GET" , url = "http://localhost:9986/ids/squashed/{films.reviews.SquashedTomatoesFilmId}")
      operation lookupFromSquashedTomatoesId(  id : String ) : IdResolution
      @HttpOperation(method = "GET" , url = "http://localhost:9986/ids/internal/{films.FilmId}")
